// import { useState } from 'react';

export default function TextBox({ idInput, label, type, value, setValue }){
    return (
    <div className="flex flex-col gap-2">
        <span className="text-2xl whitespace-nowrap">{label} : </span>
        <input id={idInput} className="rounded px-2 text-2xl" type={type} value={value || ''} onChange={e => setValue(e.target.value)}></input>
    </div>
    );
};
